import React from 'react';
import '../../App.css'; // Ensure the path is correct

const services = [
  {
    title: "Healthcare Services",
    image: "https://images.deepai.org/art-image/0d08df41773b4a7caf07eb55ac5a7c2a/a-simple-illustration-of-a-doctor-with-a-stethoscope-.jpg",
  },
  {
    title: "Pension & Finance",
    image: "https://images.deepai.org/art-image/796cb4dbb1d4411087e6c49bea5924ad/a-wallet-with-rupee-coins-and-a-pension-slip-with-an-.jpg",
  },
  {
    title: "Housing & Social Welfare",
    image: "https://images.deepai.org/art-image/8842a0b98855488ebca8645afdc6471a/a-small-home-icon-with-a-heart-inside-an-elderly-man-.jpg",
  },
  {
    title: "ID & Legal Assistance",
    image: "https://images.deepai.org/art-image/4c1e38de41c2464e8281a0bfa4536ce7/an-id-card-icon-with-legal-symbols.jpg",
  },
  {
    title: "Digital Literacy",
    image: "https://images.deepai.org/art-image/9fd216b5d9dc4e7fa05c2b51c7ad1a2f/a-senior-citizen-using-a-computer-with-a-younger-per.jpg",
  },
  {
    title: "Transportation & Travel",
    image: "https://images.deepai.org/art-image/7f0fa0be4a4a402d89ec4f179fd04f0f/transportation-icons-including-buses-trains-and-whe.jpg",
  },
  {
    title: "Food & Nutrition",
    image: "https://images.deepai.org/art-image/ab5f0f1c4e104e0db04ffb8cb2c4bafe/healthy-food-items-in-a-thali-or-plate-indian-style.jpg",
  },
  {
    title: "Entertainment & Community",
    image: "https://images.deepai.org/art-image/3f6b90f8c1fd45e5ad8239620153603e/senior-citizens-watching-a-movie-or-participating-i.jpg",
  }
];

export default function Services() {
  return (
    <div className="services-container">
      <h1 className="services-title">Explore Our Services</h1>
      <div className="services-grid">
        {services.map((service, index) => (
          <div className="service-card" key={index}>
            <img src={service.image} alt={service.title} className="service-image" />
            <h2 className="service-title">{service.title}</h2>
          </div>
        ))}
      </div>
    </div>
  );
}
